import React from "react";
import book from "./index.jpg";
import "./index.css";

function App() {
	return (
			<div class="row">
				<div class="col-md-12">
					<div class="row">
						<div class="col-md-2"></div>
						<div class="col-md-6"></div>
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
					</div>
					<div class="row">
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
						<div class="col-md-2"></div>
					</div>
				</div>
			</div>
	);
}


export default App;
